import {useParams} from "react-router-dom";
import Button from "../component/Button";
import Header from "../component/Header";
import Viewer from "../component/Viewer";

const Diary = () => {
    const headerTitle = `${pivotDate.getFullYear()}-${pivotDate.getMonth() + 1 }-${pivotDate.getFullYear()}기록`;
    const { id } = useParams();
    return (
        <div>
            <Header>
                title={headerTitle}
                leftChild={<Button text={"< 뒤로가기"} onClick={onDecreaseMonth}/>}
                rightChild={<Button text={"수정하기"} onClick={onIncreaseMonth}/>}
            </Header>
            <Viewer>
            <div>Diary: { id }</div>
            <div>Diary</div>
            </Viewer>
        </div>
    )
}

export default Diary;
